import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/common/Navbar';
import Footer from './components/common/Footer';
import Login from './components/Login/Login';
import Doglist from './components/Doglist';
import Dogdetails from './components/Dogdetails';
import Dograting from './components/Dograting';
import SuperwagList from './components/Superwaglist';
import Sharelink from './components/Sharelink';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Switch>
          <Route path="/" exact component={Login} />
          <Route path="/dogs" exact component={Doglist} />
          <Route path="/dogs/:id" component={Dogdetails} />
          <Route path="/rate" component={Dogr} />
          <Route path="/superwag" component={SuperWagListScreen} />
          <Route path="/share/:id" component={ShareLinkScreen} />
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
